import React, { Component } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {faKeyboard,faPencilAlt} from '@fortawesome/fontawesome-free-solid'
import $ from 'jquery';

class Skill extends Component{

componentDidMount(){
    
    let button =$("#delete")

    button.click(function(){
        $(this)[0].parentElement.parentElement.style.display="none"
        })
}
render() {
  
    return (
        
        <div>
          
        <div className="skill-container" style={{display:"flex",justifyContent:"space-between"}}>
            <div>
                <p>{this.props.skill}
                    <br></br>
                {this.props.level}
                </p>
               
            </div>
            <div className="skill-option">
            <span id="delete">X</span>
            
            </div>
          
            
        </div>
        
        <hr></hr>
       
    </div>
    )
}
}
export default Skill
